INSERT INTO `cocoon_scale` (`id`, `courseid`, `userid`, `name`, `scale`, `description`, `descriptionformat`, `timemodified`) VALUES
(1, 0, 0, 'Cara terpisah dan terhubung untuk mengetahui', 'Kebanyakan tahu secara terpisah,terpisah dan terhubung,Sebagian besar mengetahui dan terhubung', 'Skala didasarkan pada teori pengetahuan yang terpisah dan terhubung. Teori ini menjelaskan dua cara berbeda yang dapat kita evaluasi dan pelajari tentang hal-hal yang kita lihat dan dengar. <ul> <li> <strong> Pemisah yang terpisah </strong> tetap seobyektif mungkin tanpa menyertakan perasaan dan emosi. Dalam diskusi dengan orang lain, mereka suka mempertahankan ide-ide mereka sendiri, menggunakan logika untuk menemukan lubang dalam ide-ide lawan. </li> <li> <strong> Orang yang terhubung </strong> lebih peka terhadap orang lain. Mereka terampil dalam empati dan cenderung mendengarkan dan mengajukan pertanyaan sampai mereka merasa dapat terhubung dan \"memahami hal-hal dari sudut pandang mereka\". Mereka belajar dengan mencoba berbagi pengalaman yang mengarah pada pengetahuan yang mereka temukan pada orang lain. </li> </ul>', 0, 1649647693),
(2, 0, 0, 'Skala kompetensi bawaan', 'Belum kompeten,Kompeten', 'Skala peringkat biner yang tidak memberikan informasi lebih lanjut di luar apakah seseorang telah menunjukkan kemahiran atau tidak.', 0, 1649647693);
